import React from 'react';
import styled from "styled-components";
import {Facebook,Instagram, Twitter,Pinterest} from '@material-ui/icons';


const Container = styled.div`
    display: flex;
`;
const Left = styled.div`
    flex:1;
    display:flex;
    flex-direction: column;
    padding: 20px;
`;
const Logo = styled.h1`
`;
const Desc = styled.p`
    margin: 20px 0px;
`;
const SocialContainer = styled.div`
    display: flex;
`;
const SocialIcon = styled.div`
    cursor: pointer;
    

`;
const Center = styled.div`
    flex:1;
    padding: 20px;
`;
const Title = styled.h3`
  margin-bottom: 30px;
`;

const List = styled.ul`
  margin: 0;
  padding: 0;
  list-style: none;
  display: flex;
  flex-wrap: wrap;
`;

const ListItem = styled.li`
  width: 50%;
  margin-bottom: 10px;
`;
const Right = styled.div`
    flex:1;
`;
export default function Footer() {
  return (
    <Container>
        <Left>
            <Logo>APP</Logo>
            <Desc>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Consequuntur, animi. Ratione asperiores sunt nesciunt facere error modi amet quos eos.</Desc>
            <SocialContainer>
                <SocialIcon><Facebook /></SocialIcon>
                <SocialIcon><Instagram /></SocialIcon>
                <SocialIcon><Twitter /></SocialIcon>
                <SocialIcon><Pinterest /></SocialIcon>
            </SocialContainer>
        </Left>
        <Center>
        <Title>Useful Links</Title>
        <List>
          <ListItem>Home</ListItem>
          <ListItem>Cart</ListItem>
          <ListItem>Man Fashion</ListItem>
          <ListItem>Woman Fashion</ListItem>
          <ListItem>Accessories</ListItem>
          <ListItem>My Account</ListItem>
          <ListItem>Order Tracking</ListItem>
          <ListItem>Wishlist</ListItem>
          <ListItem>Wishlist</ListItem>
          <ListItem>Terms</ListItem>
        </List>
        </Center>
        <Right>

        </Right>
    </Container>
  );
};
